package undone.homeWorks;

public class Cars {

	public static void main(String[] args) {
		
		// TODO Auto-generated method stub
String [] cars= {"BMW", "Jeep", "Toyota", "Honda", "Kia", "Tesla"};
		
		for (String car:cars) {
			System.out.print(car+" ");
		}
		System.out.println();
		
		for (int i=0;i<6;i++) {
			System.out.print(cars[i]+" ");
		}
		System.out.println();
	}

}
